import { NOMO_DEBUG } from "js/lib/lib.js";
import { VideoBase } from "js/video/video_common.js";

export const SoopLogo = `<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" id="body_1" width="18px" height="18px" preserveAspectRatio="xMidYMid meet" zoomAndPan="magnify" version="1.0" contentScriptType="text/ecmascript" contentStyleType="text/css"><g><image x="0" y="0" xlink:href="data:image/png;base64," preserveAspectRatio="none" width="18px" height="18px" xlink:type="simple" xlink:show="embed" xlink:actuate="onLoad"/></g></svg>`;

export class VideoSoop extends VideoBase {
    constructor(options) {
        options.logoSVG = SoopLogo;
        options.type = GLOBAL.SOOP;
        options.typeName = "Soop";
        options.title = options.title.replace(/^\[클립\]/,"");
        super(options);

        this.parseDataRequired = true;
        this.start = options.start;
        NOMO_DEBUG("new VideoSoop", options);
    }

    // parse thumbnail image
    async parseData(){
        if(this.isDataLoading || this.isDataLoaded) return;
        this.isDataLoading = true;

        let urlFetch = await fetch(`https://openapi.sooplive.co.kr/vod/embedinfo?vod_url=https://vod.sooplive.co.kr/player/${this.id}`, {method: 'POST', cors:"no-cors", body: ""});
        if(urlFetch.status === 200){
            let json = await urlFetch.json();
            NOMO_DEBUG("Sooplive response", json);

            if(json.html === undefined){
                this.isDataLoading = false;
                this.isDataLoaded = true;
                this.isDataSucceed = false;
                this.showParsingError(-1, "SOOP 비디오 파싱 중 에러가 발생했습니다."+(json.msg ? "<br />"+json.msg : ""));
                return;
            }

            let src = json.html.match(/src=['"]([a-zA-Z0-9-_%&?=./:]+)['"]/);
            if(src === null) {
                this.isDataLoading = false;
                this.isDataLoaded = true;
                this.isDataSucceed = false;
                return;
            }
            let iframeUrl = src[1];
            iframeUrl = iframeUrl.replace("embed?", `embed?parent=cafe.naver.com&extension=NCCL&seq=${this.seq}&`);
            if(iframeUrl.indexOf("autoPlay") !== -1){
                iframeUrl = iframeUrl.replace(/(autoPlay=)(true|false)/,`$1${this.autoPlay}`);
            }
            if(iframeUrl.indexOf("isEmbedautoPlay") !== -1){
                iframeUrl = iframeUrl.replace(/(isEmbedautoPlay=)(true|false)/,`$1${this.autoPlay}`);
            }
            if(iframeUrl.indexOf("mutePlay") !== -1){
                iframeUrl = iframeUrl.replace(/(mutePlay=)(true|false)/,`$1${this.muted}`);
            }
            if(iframeUrl.indexOf("showChat") !== -1){
                iframeUrl = iframeUrl.replace(/(showChat=)(true|false)/,`$1${GM_SETTINGS.aftvShowChat}`);
            }
            if(this.start > 0){
                iframeUrl += `&change_second=${this.start}`;
            }
            this.iframeUrl = iframeUrl;
            this.postParseData();
        }
        else{
            this.isDataLoading = false;
            this.isDataLoaded = true;
            this.isDataSucceed = false;
            this.showParsingError(0);
        }
    }

}